import { Container } from '@material-ui/core';
import { useRouter } from 'next/router';
import { Header } from '../components/Header';

const Comment = () => {
  const router = useRouter();
  const slug = router.query.slug || [];

  return (
    <>
      <Header />
      <Container></Container>
      <h1>Slug: {slug.join(', ')}</h1>
    </>
  );
};

export default Comment;
